import React from 'react';
import DynamicFieldsForm from "../../../common/DynamicFieldsForm";
import {Button, Tabs,Divider,Table,Card , Icon } from "antd";
const TabPane = Tabs.TabPane;
class Printout extends React.Component{


	render(){
		return (<div>
			<Card>
	            <Tabs defaultActiveKey="emr">
	              <TabPane tab={<span><Icon type="cluster" />EMR</span>} key="emr">

	              </TabPane>
	              <TabPane tab={<span><Icon type="dollar" />BILLING</span>} key="billing">

	              </TabPane> 
	            </Tabs>
			</Card>
		</div>);
		 <Card>
                            {this.state.productMargin ?
                                <Tabs type="card">
                                    {this.state.productMargin.map(marginType =>
                                        <TabPane tab={marginType.name} key={marginType.id}>
                                            <h4>
                                                <div>
                                                    <Button.Group>
                                                        <Button type="primary"
                                                                onClick={() => this.editObject(marginType.id, datasource[marginType.id])}><Icon
                                                            type="edit"/> Edit</Button>
                                                        <Button type="danger"
                                                                onClick={() => that.deleteObject(marginType)}><Icon
                                                            type="delete"/> Delete</Button>
                                                    </Button.Group>
                                                </div>
                                            </h4>
                                            <Table pagination={false} dataSource={datasource[marginType.id]}
                                                   rowKey="role"
                                                   columns={columns[marginType.id]}
                                                   bordered/>
                                        </TabPane>)}
                                </Tabs> : <h4>No MLM Data</h4>}

                        </Card>
	}

}
export default Printout;
